CREATE DEFINER=`root`@`%` PROCEDURE `sp_GetStudentByAddress`(IN param_Address mediumtext)
BEGIN
 SELECT       
       `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Id` AS `STUDENT ID`,
    `studentgateaccess_system_with_sms_notification`.`tbl_students`.`RFId` AS `RFID`,
     `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Last_Name` AS `LAST NAME`,
      `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Given_Name` AS `GIVEN NAME`,
     `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Middle_Name` AS `MIDDLE NAME`,
    `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Suffix` AS `SUFFIX`,
    `studentgateaccess_system_with_sms_notification`.`tbl_genders`.`Gender` AS `GENDER`,
    `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Date_of_Birth` AS `DATE OF BIRTH`,
   `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Age` AS `AGE`,
   `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Address` AS `ADDRESS`,
   `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Contact_Person` AS `CONTACT PERSON`,
   `studentgateaccess_system_with_sms_notification`.`tbl_relationships`.`Relationship` AS `RELATIONSHIP`,
   `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Contact_Number` AS `CONTACT NUMBER`,
   `studentgateaccess_system_with_sms_notification`.`tbl_grade_levels`.`Grade_Level` AS `GRADE LEVEL`,
   `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Photo` AS `PHOTO`
       
FROM

  (((`tbl_students`
        JOIN `tbl_genders` ON ((`tbl_students`.`Gender_Id` = `tbl_genders`.`Id`)))
        JOIN `tbl_relationships` ON ((`tbl_students`.`Relationship_Id` = `tbl_relationships`.`Id`)))
        JOIN `tbl_grade_levels` ON ((`tbl_students`.`Grade_Level_Id` = `tbl_grade_levels`.`Id`)))
	
    WHERE
        (`studentgateaccess_system_with_sms_notification`.`tbl_students`.`Address` LIKE param_Address)
    ORDER BY `studentgateaccess_system_with_sms_notification`.`tbl_students`.`Id`;
END ;;
